import React, { Component } from 'react';

export default class inputCheckbox extends Component {
  render() {
    return (
      <label htmlFor="checkbox-supertrunfo">
        SuperTrunfo
        <input type="checkbox" name="supetrunfo" id="supetrunfo" />
      </label>
    );
  }
}
